import React from "react";

import { Routes, Route } from "react-router-dom";
import { createTheme, ThemeProvider } from "@mui/material";
import pages from "../Pages/index";
import { red } from "@mui/material/colors";

const routes = [
  {
    path: "/",
    page: pages.intro(),
  },
  {
    path: "/contact",
    page: pages.contact(),
  },
  {
    path: "/financial_information",
    page: pages.financial(),
  },
  {
    path: "/business_information",
    page: pages.business(),
  },
  {
    path: "/policies",
    page: pages.policies(),
  },
  {
    path: "*",
    page: pages.intro(),
  },
];

let routesArray = [];

routes.map((route) =>
  routesArray.push(<Route path={route.path} element={route.page}></Route>)
);

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
